import React from 'react';

import {BrowserRouter as Link} from 'react-router-dom';

import axios from 'axo'

function MyAccount() {
  const [list_name, setListName] = React.useState('');
  const [condition, setCondition] = React.useState('');
  const [price, setPrice] = React.useState('');
  const [available, setAvailable] = React.useState('');
  
  const addListing = () => {

  };

  return (
    <section>
      <>
            <header>
                <div className="header-bottom">
                    <div className="container">
                        <div className="row">
                            <div className="col-md-3 col-xs-8">
                                <div className="logo">
                                    <a href="#"><img src="img/logo.png" alt /></a>
                                </div>
                            </div>
                            <div className="col-md-9 hidden-sm hidden-xs">
                                <div className="mainmenu text-right">
                                    <nav>
                                        <ul id="navigation" style={{fontStyle: 'italic'}}>
                                            <li><Link to="/">Home </Link></li>
                                            <li><Link to="/About">About Us</Link></li>
                                            <li><Link to="/Contact">Contact Us</Link></li>
                                            <li className="active"><Link to="/Account">Sign Up</Link></li>
                                            <li> <Link to ="/login" >Log In</Link></li>
                                        </ul>
                                    </nav>
                                </div>
                            </div>
                            <div className="col-xs-4 hidden-lg hidden-md">
                                <div className="responsive-menu-wrap floatright"></div>
                            </div>
                        </div>
                    </div>
                </div>
            </header>

      <div className="account-area ptb-70 bg-2">
              <div className="container">
              <div className="row">
              <div className="col-md-12 ">
              <h3 className="sidebar-title" style={{textAlign: 'center'}}>Add a listing</h3>
          <div className="checkout-form">
              
              <div className="row">
              <div className="col-xs-6">
              <span>List Name<span className="star">*</span></span>
                <input 
                  placeholder="list name"
                  onChange={(e)=>{
                    setListName(e.target.value);
                  }}
                />
              </div>
              <div className="col-xs-6">
              <span>Condition<span className="star">*</span></span>
                <input 
                  placeholder="condition"
                  onChange={(e)=>{
                    setCondition(e.target.value);
                  }}
                />
              </div>
              <div className="col-xs-6">
              <span>Price<span className="star">*</span></span>
                <input 
                  placeholder="price"
                  onChange={(e)=>{
                    setPrice(e.target.value);
                  }}
                />
              </div>
              <div className="col-xs-6">
              <span>Availablity<span className="star">*</span></span>
                <input 
                  placeholder="True or False"
                  onChange={(e)=>{
                    setAvailable(e.target.value);
                  }}
                />
              </div>
              <div className=" col-md-2 col-xs-4">
              <button onClick={()=>addListing()}>Add Listing</button>
              </div>
              </div>
              
              </div>
              </div>
              </div>
              </div>
              </div>
      
      </>
    </section>
  );
};

export default MyAccount;
